    private void displayIpTimeoutValues(Map<String, List<Integer>> ipStrMap) {
		Map<String,Double> ipmap= new LinkedHashMap<>();
		for(Map.Entry<String, List<Integer>> entry :ipStrMap.entrySet())
		{   
			List<Integer> pageTimeoutValues=entry.getValue();
			int size= pageTimeoutValues.size();
			String ipVal=entry.getKey();
			int sum=0;
			double average=0;


			if(size>0)
			{
				for(Integer intVal:pageTimeoutValues)
				{
					sum+=intVal;
				}
			}
			average=sum/size;
			ipmap.put(ipVal, average);
			
		}
		List<Entry<String, Double>> list = new LinkedList<Entry<String, Double>>(ipmap.entrySet());  
		Collections.sort(list, new Comparator<Entry<String, Double>>() {
			public int compare(Entry<String, Double> obj1, Entry<String, Double> obj2) {
				return toNumeric(obj1.getKey()).compareTo(toNumeric(obj2.getKey()));
			};
		});
		

		for(Entry<String,Double>entry: list)
		{
			ipmap.put(entry.getKey(), entry.getValue());
			System.out.println(dispIpStr+entry.getKey()+dispPageTimeout+entry.getValue() );	
		}

		
    }
    
    
	static Long toNumeric(String ip) {
		try (Scanner scVal = new Scanner(ip).useDelimiter("\\.")) {
			Long l = (scVal.nextLong() << 24) + (scVal.nextLong() << 16) + (scVal.nextLong() << 8)
					+ (scVal.nextLong());

			scVal.close();
			return l;
		}
	}



